import React, { useState } from 'react';

import Dashboard  from ".././Dashboard/index.js";
import Login from '../Login/Login.js'

function App(props) {

  const [isAuthenticated, setIsAuthenticated] = useState(true)

  return (
    <>
      {isAuthenticated ? (
        <Dashboard/>
      ) : (
          <Login/>
        )
      }
    </>
  );
}

export default App;
